import React, { useEffect , useState } from 'react'
import './styles.css';
import { useSelector , useDispatch } from 'react-redux';
import { checkTempMin, checkTempMax, inputUsed } from '../Redux/actions'
import TempsCheck from '../Components/TempsCheck'

function TempsCalled() {

const checkInput = useSelector(state => state.checkTemps);
const hasInput = useSelector(state => state.inputUsed)
const dispatch = useDispatch();

 useEffect(() => {
    dispatch(checkTempMin());
    dispatch(checkTempMax());
 },[dispatch]);

 return(
    
   hasInput ?
    <TempsCheck />
   
   : (<div> Necessário input para exibição</div>)
 )
    
}

export default TempsCalled;
